sys_variable_value.value:
(function execute(inputs, outputs) {
	if (inputs.status_code == '200') {
		var response = JSON.parse(inputs.response);
		outputs.primary_name_attribute = response.PrimaryNameAttribute;
		outputs.primary_id_attribute = response.PrimaryIdAttribute;
		outputs.entity_set_name = response.EntitySetName;
	} else {
		inputs.fields = "error";
		outputs = new MicrosoftDynamicsCRMErrorHandler()
			.getRecordsErrorHandler(inputs, outputs);
	}
})(inputs, outputs);

