sys_variable_value.value:
(function execute(inputs, outputs) {
	inputs = new MicrosoftDynamicsCRMUtils().trimStringInputs(inputs);
	if (inputs.status_code == '200') {
		outputs.status = 'Success';
		var response = JSON.parse(inputs.response);
		var payload = response.value;
      	outputs.count = response['@odata.count'];
		var fields = {
			data: []
		};
		payload.map(function(item) {
			fields.data.push({
				"name": item[inputs.primary_id_attribute],
				"label": item[inputs.primary_name_attribute]
			});
		});
		outputs.tables = fields;
	} else
		outputs = new MicrosoftDynamicsCRMErrorHandler()
		.getRecordsErrorHandler(inputs, outputs);
})(inputs, outputs);

